Insert into ADMIN.TBL_STUDY_APPLICATION (FETCHAPPLICATIONID,FETCHAPPSTUDYID,FETCHAPPUSERID,SELFINTRO,STUDYGOAL,STUSTATUS,ADDITIONALQUESTIONS,FETCHAPPLICATION_DATE,FETCHAPPLSTATUS,REJECTIONMESSAGE,SGHIDE) values (443,400000154,'admin','현수씨가 그랬어요','현수씨가 그랬어요','user','현수씨가 그랬어요',to_date('24/10/11','RR/MM/DD'),'Y',null,'N');
Insert into ADMIN.TBL_STUDY_APPLICATION (FETCHAPPLICATIONID,FETCHAPPSTUDYID,FETCHAPPUSERID,SELFINTRO,STUDYGOAL,STUSTATUS,ADDITIONALQUESTIONS,FETCHAPPLICATION_DATE,FETCHAPPLSTATUS,REJECTIONMESSAGE,SGHIDE) values (362,400000157,'user02','안녕하세요, 저는 새로운 기술을 배우고자 하는 열정이 가득한 박태준입니다. 주로 프론트엔드 개발을 해왔지만 백엔드 기술, 특히 스프링에 대해 더 깊이 배우고 싶어 참여하게 되었습니다.','이번 프로젝트를 통해 스프링 부트와 데이터 접근 기술을 심도 있게 다루는 방법을 배우고 싶습니다. 또한 RESTful API 설계와 구현 능력을 개발하고, 팀원들과의 협업을 통해 종합적인 소프트웨어 개발 능력을 향상시키고자 합니다.','user','이 프로젝트에서 가장 기대하는 부분이 무엇인가요?',to_date('24/10/05','RR/MM/DD'),'Y','ㅇㅇㅇㅇ','N');
Insert into ADMIN.TBL_STUDY_APPLICATION (FETCHAPPLICATIONID,FETCHAPPSTUDYID,FETCHAPPUSERID,SELFINTRO,STUDYGOAL,STUSTATUS,ADDITIONALQUESTIONS,FETCHAPPLICATION_DATE,FETCHAPPLSTATUS,REJECTIONMESSAGE,SGHIDE) values (365,400000157,'user06','저는 자바 개발자 안지현이고, 특히 스프링 프레임워크를 사용한 웹 애플리케이션 개발에 경험이 많습니다. 팀 프로젝트를 통해 새로운 기술을 배우고 싶어서 이 그룹에 참여하게 되었습니다.','프로젝트에서 스프링 시큐리티를 이용하여 강력한 인증 및 권한 관리 시스템을 구축하는 방법을 배우고 싶습니다.','user','프로젝트를 통해 개인적으로 해결하고 싶은 기술적 문제가 있나요?',to_date('24/10/05','RR/MM/DD'),'ㅠ','테스트','N');
Insert into ADMIN.TBL_STUDY_APPLICATION (FETCHAPPLICATIONID,FETCHAPPSTUDYID,FETCHAPPUSERID,SELFINTRO,STUDYGOAL,STUSTATUS,ADDITIONALQUESTIONS,FETCHAPPLICATION_DATE,FETCHAPPLSTATUS,REJECTIONMESSAGE,SGHIDE) values (367,400000157,'user08',' 안녕하세요, 저는 백엔드 개발자 김태호입니다. 저는 기술적 도전을 즐기며, 특히 스프링 프레임워크를 통한 서버 사이드 개발에 관심이 많습니다.',' 프로젝트를 통해 스프링 부트와 스프링 클라우드를 사용하여 대규모 분산 시스템을 설계하고 구현하는 경험을 쌓고 싶습니다.','user','프로젝트에서 가장 기대하는 학습 결과는 무엇인가요?',to_date('24/10/05','RR/MM/DD'),'Y','그냥','Y');
Insert into ADMIN.TBL_STUDY_APPLICATION (FETCHAPPLICATIONID,FETCHAPPSTUDYID,FETCHAPPUSERID,SELFINTRO,STUDYGOAL,STUSTATUS,ADDITIONALQUESTIONS,FETCHAPPLICATION_DATE,FETCHAPPLSTATUS,REJECTIONMESSAGE,SGHIDE) values (372,400000195,'user12','방장 자동가입','방장 자동가입','admin','방장 자동가입',to_date('24/10/05','RR/MM/DD'),'Y',null,'N');
Insert into ADMIN.TBL_STUDY_APPLICATION (FETCHAPPLICATIONID,FETCHAPPSTUDYID,FETCHAPPUSERID,SELFINTRO,STUDYGOAL,STUSTATUS,ADDITIONALQUESTIONS,FETCHAPPLICATION_DATE,FETCHAPPLSTATUS,REJECTIONMESSAGE,SGHIDE) values (364,400000157,'user05','안녕하세요! 저는 소프트웨어 엔지니어로 일하고 있는 이윤지입니다. 스프링과 JPA를 이용한 복잡한 도메인 모델링에 관심이 많습니다. 이번 모임을 통해 실력을 한층 업그레이드하고자 합니다.','스프링 부트를 이용한 마이크로서비스 아키텍처 설계 및 구현 능력을 개발하고, 동시에 성능 최적화 기법을 실습하고자 합니다.','user','이 모임을 통해 어떤 경험을 가장 얻고 싶으신가요?',to_date('24/10/05','RR/MM/DD'),'Y',null,'N');
