Insert into ADMIN.TBL_STUDY_APPLICATION (FETCHAPPLICATIONID,FETCHAPPSTUDYID,FETCHAPPUSERID,SELFINTRO,STUDYGOAL,STUSTATUS,ADDITIONALQUESTIONS,FETCHAPPLICATION_DATE,FETCHAPPLSTATUS,REJECTIONMESSAGE,SGHIDE) values (363,400000157,'user03','안녕하세요, 저는 백엔드 개발자로 일하고 있는 최다인입니다. Java와 스프링을 활용한 서버 개발에 흥미가 있으며, 다양한 프로젝트를 통해 기술을 연마하고자 합니다.','저는 스프링 시큐리티와 클라우드 서비스 통합에 대해 배우고 싶습니다. 이번 모임을 통해 보안이 강화된 스프링 기반 애플리케이션을 만들어 보고, 클라우드 인프라와의 연동 경험도 쌓고 싶습니다.','admin','프로젝트에서 어떤 역할을 맡고 싶으신가요?',to_date('24/10/05','RR/MM/DD'),'Y','ㅇㅇㅇㅇ','N');
Insert into ADMIN.TBL_STUDY_APPLICATION (FETCHAPPLICATIONID,FETCHAPPSTUDYID,FETCHAPPUSERID,SELFINTRO,STUDYGOAL,STUSTATUS,ADDITIONALQUESTIONS,FETCHAPPLICATION_DATE,FETCHAPPLSTATUS,REJECTIONMESSAGE,SGHIDE) values (368,400000157,'user09','안녕하세요, 저는 경험이 풍부한 소프트웨어 개발자 박하늘입니다. 다양한 프로젝트를 통해 실력을 쌓아왔으며, 최근에는 스프링 기반의 프로젝트에 많은 관심을 가지고 있습니다.','저는 특히 스프링을 이용한 함수형 프로그래밍에 관심이 많으며, 이번 모임을 통해 관련 실습과 경험을 확장하고자 합니다.','user','어떤 유형의 프로젝트가 가장 도전적이라고 생각하시나요?',to_date('24/10/05','RR/MM/DD'),'Y','ㅇㅇㅇ','N');
Insert into ADMIN.TBL_STUDY_APPLICATION (FETCHAPPLICATIONID,FETCHAPPSTUDYID,FETCHAPPUSERID,SELFINTRO,STUDYGOAL,STUSTATUS,ADDITIONALQUESTIONS,FETCHAPPLICATION_DATE,FETCHAPPLSTATUS,REJECTIONMESSAGE,SGHIDE) values (369,400000157,'user11','저는 프론트엔드 개발자로 일하며 백엔드 기술에 대한 이해를 넓히고자 스프링을 공부하고 있는 조민준입니다. 실용적인 프로젝트 경험을 통해 전문성을 키우고 싶습니다.','이번 프로젝트에서는 스프링 부트를 이용한 마이크로서비스 구축 방법을 배우고 싶습니다.','user','프로젝트를 선택할 때 가장 중요하게 생각하는 기준은 무엇인가요?',to_date('24/10/05','RR/MM/DD'),'N','ㅇㅇㅇ','N');
